import React from "react";
import { Link } from "react-router-dom";
import { Navbar, Container, NavbarBrand } from "react-bootstrap";

const Header = () => {
  return (
    <Navbar bg="light">
      <Container>
        <Navbar.Brand>
          <NavbarBrand>
            <Link to="/">stremas</Link>
          </NavbarBrand>
          <NavbarBrand>
            <Link to="/"> all stremas</Link>
          </NavbarBrand>
        </Navbar.Brand>
      </Container>
    </Navbar>
  );
};
export default Header;
